```

### 2. RedisPassword
```java
public static RedisPassword of(@Nullable String passwordAsString) {

return Optional.ofNullable(passwordAsString) //
		.filter(StringUtils::hasText) //
		.map(it -> new RedisPassword(it.toCharArray())) //
		.orElseGet(RedisPassword::none);
}
```

